import React from 'react';
import First from './First';
import Second from './Second';

const TaskContainer = (props) => {
    return (
        <div>
            {
                props.number === 1 ?
                    <First
                        team={props.team}
                        history={props.history}
                        changeStep={props.changeStep}
                    />
                    :
                    props.number === 2 ?
                        <Second 
                            team={props.team}
                            history={props.history}
                            changeStep={props.changeStep}
                        />
                        :
                        null
            }
        </div>
    )
}

export default TaskContainer;
